dot("$(0,3)$", (0,3), W);
dot("$(4,1)$", (4,1), E);
dot("$(3,0)$", (3,0), S);
dot("$(1,4)$", (1,4), N);
[/asy]

The region then is a rectangle with side lengths $\sqrt{2}$ and $3 \sqrt{2},$ so its area is $(\sqrt{2})(3 \sqrt{2}) = \boxed{6}.$

